import './chart.css'
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';


export default function Chart() {

    const data = [
        {
          name: 'Page A',
          "Active Users": 4000,
          pv: 2400,
          amt: 2400,
        },
        {
          name: 'Page B',
          "Active Users": 3000,
          pv: 1398,
          amt: 2210,
        },
        {
          name: 'Page C',
          "Active Users": 2000,
          pv: 9800,
          amt: 2290,
        },
        {
          name: 'Page D',
          "Active Users": 2780,
          pv: 3908,
          amt: 2000,
        },
        {
          name: 'Page E',
          "Active Users": 1890,
          pv: 4800,
          amt: 2181,
        },
        {
          name: 'Page F',
          "Active Users": 2390,
          pv: 3800,
          amt: 2500,
        },
        {
          name: 'Page G',
          "Active Users": 3490,
          pv: 4300,
          amt: 2100,
        },
      ];
    return (
        <div className='chart'>
            <h3 className="chartTitle">
                Travel Analytics
            </h3>

            <ResponsiveContainer width="100%" aspect={4/1}>
                <LineChart  data={data}>
                    <XAxis dataKey="name" stroke='#5550bd' />
                    <Line type="monotone" dataKey="Active Users"/>
                </LineChart>

            </ResponsiveContainer>

        </div>
    )
}
